import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input_filled.png'));

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Wait for search results
    await page.waitForSelector('.products-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_search_results_displayed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_search_results_displayed.png'));

    // Extract some data from the results
    const results = await page.$$eval('.product-card', cards => cards.map(card => card.innerText));

    return {
      success: true,
      action: "Performed search and captured results",
      extractedData: { results },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
